import { toBePartiallyChecked } from '@testing-library/jest-dom/dist/matchers';
import React from 'react';
import Tilt from 'react-parallax-tilt';

const Logo = () => {
    return (
        <div className='ma4 mt0' style={{display: 'flex', justifyContent: 'left'}}>
            <Tilt className='br2 shadow-2'>
                <div style={{ height: '200px', backgroundColor: 'teal', display: 'flex', alignItems: 'center', border: '0px solid black', borderRadius: '15px'}}>
                    <h1>React Parallax Tilt</h1>
                </div>
            </Tilt>
        </div>
    )
}

export default Logo;
